(function() {
    var ListCtrl;
    ListCtrl = function() {
        ListCtrl.$inject = [ "$scope", "sampleData", "editDialog" ];
        function ListCtrl($scope, sampleData, editDialog) {
            var _this = this;
            this.data = sampleData.generate(100);
            $scope.data = this.data;
            $scope.gridOptions = {
                data: this.data,
                datatype: "local",
                colModel: this.gridColumns(),
                sortname: "id"
            };
            $scope.editItem = function(id) {
                var item, self;
                item = _this.findItemById(id);
                item.persisted = function() {
                    return true;
                };
                item.save = function(callback) {
                    return callback.success(this);
                };
                self = _this;
                item["delete"] = function(callback) {
                    self.deleteItemById(id);
                    return callback.success(this);
                };
                return editDialog.open("templates/partials/itemForm.html", item);
            };
            $scope.createItem = function() {
                var item;
                item = {};
                item.persisted = function() {
                    return false;
                };
                item.save = function(callback) {
                    var generateId;
                    generateId = function() {
                        return new Date().getTime();
                    };
                    item.id = generateId();
                    return callback.success(this);
                };
                return editDialog.open("templates/partials/itemForm.html", item).then(function(item) {
                    return _this.data.push(item);
                });
            };
            $scope.deleteItem = function(id) {
                var item;
                item = _this.deleteItemById(id);
                return $scope.$broadcast("itemDeleted", item);
            };
        }
        ListCtrl.prototype.findItemById = function(id) {
            id = parseInt(id);
            return _.find(this.data, function(row) {
                return row.id === id;
            });
        };
        ListCtrl.prototype.deleteItemById = function(id) {
            var row;
            row = this.findItemById(id);
            if (row != null) {
                this.data = _.reject(this.data, function(item) {
                    return item.id === row.id;
                });
                return row;
            }
        };
        ListCtrl.prototype.gridColumns = function() {
            return [ {
                name: "id",
                label: "Inv No",
                width: 60,
                sorttype: "int"
            }, {
                name: "customer.name",
                label: "Customer",
                formatter: "editActionLink"
            }, {
                name: "invoiceDate",
                label: "Date"
            }, {
                name: "note",
                label: "Note"
            }, {
                name: "complete",
                label: "Complete"
            } ];
        };
        return ListCtrl;
    }();
    angular.module("angleGrinder").controller("ListCtrl", ListCtrl);
}).call(this);

(function() {
    var UsersListCtrl, UsersSearchFormCtrl;
    UsersListCtrl = function() {
        UsersListCtrl.$inject = [ "$scope", "$log", "$dialog", "confirmationDialog", "editDialog", "Users", "pathWithContext" ];
        function UsersListCtrl($scope, $log, $dialog, confirmationDialog, editDialog, Users, pathWithContext) {
            $scope.showSearchForm = true;
            $scope.gridOptions = {
                url: pathWithContext("/api/users"),
                colModel: this.gridColumns(),
                rowNum: 10,
                sortname: "id"
            };
            $scope.editItem = function(id) {
                return Users.get({
                    id: id
                }, function(user) {
                    return editDialog.open(pathWithContext("templates/partials/userForm.html"), user);
                });
            };
            $scope.createItem = function() {
                var user;
                user = new Users();
                return editDialog.open(pathWithContext("templates/partials/userForm.html"), user);
            };
            $scope.deleteItem = function(id) {
                return confirmationDialog.open().then(function(confirmed) {
                    var user;
                    if (!confirmed) {
                        return;
                    }
                    user = new Users({
                        id: id
                    });
                    return user["delete"]({
                        success: function(response) {
                            return $scope.$broadcast("itemDeleted", response);
                        },
                        error: function(response) {
                            return $log.error("Something went wront", response);
                        }
                    });
                });
            };
            $scope.quickSearch = function(search) {
                return $scope.$broadcast("searchUpdated", search);
            };
        }
        UsersListCtrl.prototype.gridColumns = function() {
            return [ {
                name: "id",
                width: 50,
                formatter: "editActionLink"
            }, {
                name: "login",
                label: "Login",
                formatter: "editActionLink"
            }, {
                name: "name",
                label: "Name",
                formatter: "editActionLink"
            }, {
                name: "allowance",
                label: "Allowance"
            }, {
                name: "birthday",
                label: "Birthday"
            }, {
                name: "paid",
                label: "Paid"
            } ];
        };
        return UsersListCtrl;
    }();
    UsersSearchFormCtrl = function() {
        UsersSearchFormCtrl.$inject = [ "$scope" ];
        function UsersSearchFormCtrl($scope) {}
        return UsersSearchFormCtrl;
    }();
    angular.module("angleGrinder").controller("UsersListCtrl", UsersListCtrl).controller("UsersSearchFormCtrl", UsersSearchFormCtrl);
}).call(this);

