(function() {
    var FormCtrl;
    FormCtrl = function() {
        FormCtrl.$inject = [ "$scope", "$location", "user" ];
        function FormCtrl($scope, $location, user) {
            $scope.user = user;
            $scope.serverValidationErrors = {};
            $scope.save = function(user) {
                var onError, onSuccess;
                if ($scope.editForm.$invalid) {
                    return;
                }
                $scope.serverValidationErrors = {};
                onSuccess = function(user) {
                    return $location.path("/users/" + user.id);
                };
                onError = function(response) {
                    var errors;
                    if (response.status === 422) {
                        errors = response.data.errors;
                        return $scope.serverValidationErrors = errors[user.resourceName()];
                    }
                };
                return user.save({
                    success: onSuccess,
                    error: onError
                });
            };
            $scope["delete"] = function(user) {
                var onSuccess;
                onSuccess = function() {
                    return $location.path("/users");
                };
                return user["delete"]({
                    success: onSuccess
                });
            };
        }
        return FormCtrl;
    }();
    angular.module("angleGrinder").controller("users.FormCtrl", FormCtrl);
}).call(this);